import face_recognition
import os 
import glob
from PIL import Image
import sys
import shutil


user_img_path = '/workspace/cropped/'
match_output_path = '/workspace/matched/'
rejected_output_path = '/workspace/rejected/'
compare_path = '/workspace/stable-diffusion-webui/outputs/txt2img-images/'
images = glob.glob(f"{user_img_path}/*")
compare_images = glob.glob(f"{compare_path}/*")

if not os.path.exists(match_output_path):
    os.makedirs(match_output_path)

if not os.path.exists(rejected_output_path):
    os.makedirs(rejected_output_path)

comparewith = "/home/ian/projs/stable-diffusion-webui/outputs/txt2img-images/00027-3175610747-paularedygg person, beautiful Norse Warrior based on Devil with glowing aura by Greg Rutkowski and Raymond Swanland, Trending on.png"
found = False

last_compared_img = ''
for image in images:
    if found:
        # this image already matched, no need to match with other pics
        found = False
        continue
    picture_of_me = face_recognition.load_image_file(image)
    pic_encodings = face_recognition.face_encodings(picture_of_me)
    if len(pic_encodings) == 0:
        print('cannot read face from ' + image)
        continue
    for comparison_image in compare_images:
        # if last_compared_img != '' and last_compared_img != comparison_image and found == False:
        #     # last_compared_img can be a candidate for inpainting
        #     print(last_compared_img + ' may be a candidate for inpainting')

        # last_compared_img = comparison_image

        # print(image)
        # loaded_img = face_recognition.load_image_file(image)
        # face_locations = face_recognition.face_locations(loaded_img)
        my_face_encoding = pic_encodings[0]
        # im = Image.open(image)

        unknown_picture = face_recognition.load_image_file(comparison_image)
        unknown_pic_encodings = face_recognition.face_encodings(unknown_picture)
        if len(unknown_pic_encodings) == 0:
            print('cannot read face from dest')
            # reject this photo
            shutil.move(comparison_image, rejected_output_path)
            continue
        unknown_face_encoding = unknown_pic_encodings[0]

        results = face_recognition.compare_faces([my_face_encoding], unknown_face_encoding, tolerance=0.5)

        if results[0] == True:
            print("It's a picture of me: " + comparison_image)
            # print(comparison_image)
            # print(image)
            found = True
            shutil.move(comparison_image, match_output_path)
            continue
        else:
            print("It's not a picture of me!")
    
    compare_images = glob.glob(f"{compare_path}/*")

